Мы приветствуем Вас, дорогие посетители!

 - У нас Вы сможете найти интересные и разнообразные вещи (по разумным ценам);
 - Бесплатная доставка на дом;
 - Доставка (от 14 дней до 30-ти), для некоторых товаров доставка чуть дольше;
 - Наш товар из Германии, Франции, Китая, США, Великобритании.
 - Предоплата 50%.
 - Доставка в другие города по договорённости
